import { Box, Card, Container, Grid, Typography } from "@mui/material";

const Services = () => {
  return (
    <Container sx={{ py: 2 }}>
      <Typography
        variant="h2"
        sx={{
          textAlign: "center",
          color: "#000032",
          mb: 2,
          fontWeight:"bold"
        }}
      >
        Services     
      </Typography>
      <Grid container>
        <Grid xs={12} md={6}>
          <Card elevation={5}>
            <Box sx={{display:"flex", justifyContent:"center"}}>
            <Typography>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Maiores et itaque inventore, odit eaque, illo facere, tenetur vitae ipsam expedita aperiam iste modi possimus? Esse nihil quia quo beatae sit!
            </Typography>              
            </Box>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Services;
